    public func lex(_ input: String) throws -> [Token] {
        
        self.index = 0
        self.input = input
        
        self.line = 0
        self.col = 0
        
        tokens = []
        
        while (index < input.count) {
            
            if let token = try nextToken() {
                tokens.append(token)
            }
            
        }
        
        return tokens
        
    }
    
    private func nextToken() throws -> Token? {
        
        let maximalMunch = simulateDFAs()
        
        let attributes = maximalMunch.simulator.attributes
        let type = maximalMunch.simulator.type
        let content = try sliceInput(with: index, maximalMunch.lastAccepting)
        
        let newLines = content.filter {$0 == "\n"} .count
        
        if (newLines > 0) {
            col = -1
            line += newLines
        }
        
        let startCol = col
        
        adjustIndices(maximalMunch)
        
        let endCol = col - 1
        
        if (attributes.contains(.discard)) {
            return nil
        }
        
        let region = Region(line, startCol, line, endCol)
        
        if attributes.contains(.selfType) {
            return Token(content, content, region)
        }
        
        return Token(type, content, region)
        
    }
    
    private func simulateDFAs() -> SimulatorResult {
        
        var results: [SimulatorResult] = []
        
        for (simulator) in (simulators) {
            let lastAccepting = simulator.simulateUntilDead(input, index)
            results.append((simulator, lastAccepting))
        }
        
        let sortedResults = results.sorted {
            
            if ($0.lastAccepting == $1.lastAccepting) {
                return $0.simulator.specificationPrecedence > $1.simulator.specificationPrecedence
            }
            
            return $0.lastAccepting > $1.lastAccepting
            
        }
        
        return sortedResults[0]
        
    }
    
    private func sliceInput(with index: Int, _ lastAccepting: Int) throws -> String {
        
        let startIndex = input.index(input.startIndex, offsetBy: index)
        let endIndex = input.index(input.startIndex, offsetBy: lastAccepting)
        
        guard (endIndex > startIndex) else {
            print("Throwing. startIndex = \(index)")
            print(tokens)
            throw LexError.invalidCharacter(input[startIndex])
        }
        
        let slice = input[startIndex ..< endIndex]
        
        return String(slice)
        
    }
    
    private func adjustIndices(_ result: SimulatorResult) {
        
        let lastAccepting = result.lastAccepting
        col += lastAccepting - index
        index = lastAccepting
        
    }
    
}

private class DFASimulator {
    
    private let table: Table
    private var state: Int
    
    private var input: String = ""
    
    var type: String { table.specification.type }
    var attributes: [TokenSpecificationAttribute] { table.specification.attributes }
    var specificationPrecedence: Int { table.specification.specificationPrecedence }
    
    init(_ table: Table) {
        self.table = table
        self.state = table.entry
    }
    
    /// Returns the last accepting length
    func simulateUntilDead(_ input: String, _ index: Int) -> Int {
        
        reset()
        
        var index = index
        var lastAccepting = 0
        
        self.input = input
        
        while (state > 0) {
            
            guard let char = self[index] else {
                return lastAccepting
            }
            
            state = table.getStateAtTransition(for: char, in: state)
            
            index += 1
            
            if table.isAccepting(state) {
                lastAccepting = index
            }
            
        }
        
        return lastAccepting
        
    }
    
    private func reset() {
        
        state = table.entry
        
    }
    
    private subscript(index: Int) -> Character? {
        
        guard index < input.count else { return nil }
        
        let stringIndex = input.index(input.startIndex, offsetBy: index)
        return input[stringIndex]
        
    }
    
}

public struct Token: CustomStringConvertible {
    
    public var type: String
    public var content: String
    public var region: Region
    
    public var description: String {
        
        var string = type
        
        string += String(repeating: " ", count: 20)
        string.removeLast(string.count - 20)
        
        string += content
        
        string += String(repeating: " ", count: 30)
        string.removeLast(string.count - 40)
        
        string += "\(region)"
        
        return string
        
    }
    
    public init(_ type: String, _ content: String, _ region: Region) {
        
        self.type = type
        self.content = content
        self.region = region
        
    }
    
}

public struct Region: CustomStringConvertible {

    var startLine: Int
    var startCol: Int
    var endLine: Int
    var endCol: Int
    
    public var description: String {
        "ln \(startLine) col \(startCol) -> ln \(endLine) col \(endCol)"
    }
    
    init(_ startLine: Int, _ startCol: Int, _ endLine: Int, _ endCol: Int) {
        
        self.startLine = startLine
        self.startCol = startCol
        self.endLine = endLine
        self.endCol = endCol
        
    }
    
}

private struct Table {
    
    var simulatedDFA: [[Character : Int]] = []
    
    var entry = -1
    
    var accepting: Set<Int> = []
    
    let specification: TokenSpecification
    
    init(_ specification: TokenSpecification) {
        
        self.specification = specification
        
    }
    
    init(_ simulatedDFA: [[Character : Int]], _ entry: Int, _ accepting: Set<Int>, _ specification: TokenSpecification) {
        
        self.simulatedDFA = simulatedDFA
        self.entry = entry
        self.accepting = accepting
        self.specification = specification
        
    }
    
    func getStateAtTransition(for char: Character, in state: Int) -> Int {
        return simulatedDFA[state][char]  ??  0
    }
    
    func isAccepting(_ state: Int) -> Bool {
        return accepting.contains(state)
    }
    
}

private struct TokenSpecification {
    
    let type: String
    let attributes: [TokenSpecificationAttribute]
    let specificationPrecedence: Int
    
    init(_ specificationPrecedence: Int, _ type: String, _ attributes: [TokenSpecificationAttribute]) {
        
        self.specificationPrecedence = specificationPrecedence
        self.type = type
        self.attributes = attributes
        
    }
    
}



enum TokenSpecificationAttribute {
    
    case discard
    case selfType
    
}

enum LexError: Error {

    case invalidCharacter(_ char: Character)
    
}
